import React from 'react';
import PopupWithForm from './PopupWithForm';

export default function InfoToolTip({ open, handleClose, isRegistered }) {
  return (
    <>
      <PopupWithForm
        nam={'register_error'}
        open={open}
        onClose={handleClose}
        isRegistered={isRegistered}
      >
        <div
          className={
            isRegistered
              ? 'popup__register_registered'
              : 'popup__register_error'
          }
        >
          {isRegistered
            ? '¡Correcto! Ya estás registrado.'
            : 'Uy, algo salió mal. Por favor, inténtalo de nuevo.'}
        </div>
      </PopupWithForm>
    </>
  );
}
